import React, { Component } from 'react';
import './App.css';

import TodoList from './Todo/TodoList'

class App extends Component {
    constructor(props){
        super(props);
        this.state = {
            list: []
        }
    }

  render() {
    return (

        <TodoList/>

    );
  }
}

export default App;
